import React, { Component } from "react";
import ProductsTable from "../components/ProductsTable";

class DetailsPage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <ProductsTable productsData={this.props.data} />
      </div>
    );
  }
}

export default DetailsPage;
